webpackJsonp([0x8f5f79b5a54d],{8965:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"10-run seventh inning",date:"14 Oct 2002",slug:"/2002-10-14-10-run-seventh-inning/",tags:"Y2002"},html:"<p>Star Tribune: <a href=\"http://www.startribune.com/stories/509/3363555.html\">Angels' 10-run seventh ends Twins' season</a>. And now there's one less thing in the world to worry about, namely the World Series. <a href=\"http://davespicks.com/archive/2002/1014.html\">Dave's Picks</a> comments: \"Baseball's a funny game sometimes. The bottom of the seventh in yesterday's game was not one of them.\" Amen.</p>"},next:{fields:{title:"The Disadvantage of Sidebars",date:"13 Oct 2002",slug:"/2002-10-13-the-disadvantage-of-sidebars/"}},previous:{fields:{title:"Pictures for the Passport",date:"15 Oct 2002",slug:"/2002-10-15-pictures-for-the-passport/"}}},{node:{fields:{title:"The Disadvantage of Sidebars",date:"13 Oct 2002",slug:"/2002-10-13-the-disadvantage-of-sidebars/",tags:"Y2002"},html:"<p>b2 includes a posting sidebar for Mozilla. It's handy for keeping windows open when typing a post. However, don't try switching to another sidebar when writing. I wanted to search Google for the last sentence of a post, hit the Search sidebar, and my post was gone. Oh well, it wasn't that good anyway. But it was better than this one.</p>"},next:{fields:{title:"Seventy-five Percent",date:"12 Oct 2002",slug:"/2002-10-12-seventy-five-percent/"}},previous:{fields:{title:"10-run seventh inning",date:"14 Oct 2002",slug:"/2002-10-14-10-run-seventh-inning/"}}},{node:{fields:{title:"Seventy-five Percent",date:"12 Oct 2002",slug:"/2002-10-12-seventy-five-percent/",tags:"Y2002"},html:"<p>Thursday was the deadline for the employees to agree to the salary cuts proposed by my employer. Management had said that only with 90% agreement could lay-offs be avoided. I didn't catch the final figures, but at best only 75% are on board. The mood is one of awaiting the inevitable. I've never had so much quiet at work. I'm getting more done than ever.</p>"},next:{fields:{title:"OpenOffice",date:"11 Oct 2002",slug:"/2002-10-11-openoffice/"}},previous:{fields:{title:"The Disadvantage of Sidebars",date:"13 Oct 2002",slug:"/2002-10-13-the-disadvantage-of-sidebars/"}}}],pathPrefix:"",first:!1,last:!1,index:832,pageCount:1101}}}});
